            <Alert.Heading className="d-flex justify-content-center">
              RESCUE REQUEST
            </Alert.Heading>
            <div className="d-flex justify-content-end pt-3">
              Victim Id:1212
            </div>
          </Alert>
          <Form className="mt-1 p-3">
            <b>Dear **** **** (4545456)</b>
            <p>
              Thank You ! for using our online portal. Your request details are
              indicated below.
            </p>
            <br></br>
            <Stack direction="horizontal" gap={5}>
              <div>
                <b>Request ID :</b> 45456{" "}
              </div>
              <div>
                <b> Request Date :</b> 22/06/2022
              </div>
            </Stack>
            <div>
              <b> Name :</b> **** **** 
            </div>
            <div>
              <b> Address :</b> south east,towar road,california
            </div>
            <div>
              <b> Contact No. :</b> +1122152454
            </div>
            <div>
              <b> Total Members in Group :</b> 12
            </div>
            <div className="d-flex justify-content-center mt-5">
              <Button variant="primary" type="submit">
                Print
              </Button>
            </div>
          </Form>
        </Card>
      </div>
    </>
  );
}

export default RequestSlip;
